import React, {useState} from 'react';

const Menu = ({props}) => {


    //State para elegir el menu
    const [equipo, cambiarEquipo] = useState(true)({
        //nombre: 1
    });

    /*
    let nombreMen = 1;

    function handleClick(e) {
        e.preventDefault();
        nombreMen=5;
        console.log('cambiarMenu aca: ' + nombreMen);
    }

    <a href="#"
                onClick = {handleClick}>Jugadores
            </a>
    */

    return (
        <header className="app-menu">
            <nav className="nav-principal">
                 <a href="#">Equipo</a>
            </nav>
            <button onClick={() => cambiarEquipo(!equipo)} type="button">
                Jugadores
            </button>
            <a href="#">Plantel</a>
            <a href="#">Partidos</a>
            <a href="#">Formacion</a>
            <a href="#">Entrenamientos</a>
            <a href="#">Reportes</a>
        </header>
    );
}
export default Menu;
